import UIKit
import WebKit

class ViewController: UIViewController {
    let label: UILabel = {
        let v = UILabel(frame: .zero)
        v.text = "なんか表示するスペース"
        v.translatesAutoresizingMaskIntoConstraints = false
        return v
    }()
    
    let webView: WKWebView = {
        let webConfig = WKWebViewConfiguration()
        // インライン再生の許可設定
        webConfig.allowsInlineMediaPlayback = true
        let v = WKWebView(frame: .zero, configuration: webConfig)
        v.translatesAutoresizingMaskIntoConstraints = false
        // ジェスチャー許可しない
        v.allowsBackForwardNavigationGestures = false
        return v
    }()
    
    var htmlString: String = """
<h1>h1.テスト</h1><p><b>太字</b></p><p><span style="font-family: Arial;"><u>アンダーライン</u></span></p><p><span style="font-family: Arial;"><u><br></u></span></p><ul><li><span style="font-family: Arial;">リスト</span></li><li>リスト</li><li>リスト</li></ul><p><br></p><ol><li>番号付き</li><li>番号付き</li><li>番号付き</li></ol><p style="text-align: center; "><font style="background-color: rgb(255, 255, 0);" color="#ff0000">中央寄せ文字赤背景黄色</font></p><p style="text-align: left;"><font style="background-color: rgb(255, 255, 0);" color="#ff0000"><br></font></p><p style=""><a href="https://www.google.com/" target="_blank">googleへのリンク</a></p><p style=""><br></p><p style="">・画像</p><p style=""><img src="data:image/png;base64," style="width: 25%;" data-filename="20211126221510.png"><br><font color="#ff0000"><br></font></p><p>・動画</p><p><br></p><iframe width="1264" height="711" src="https://www.youtube.com/embed/9zBCkWd7eKo?playsinline=1" title="「覇邪の封印」（Live BD/DVD 『覇道征舞』Official Preview）" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
"""

    override func viewDidLoad() {
        super.viewDidLoad()
        
        setUp()
    }

    private func setUp() {
        view.backgroundColor = .white
        view.addSubview(label)
        view.addSubview(webView)
        
        NSLayoutConstraint.activate([
            label.topAnchor.constraint(equalTo: view.safeAreaLayoutGuide.topAnchor),
            label.trailingAnchor.constraint(equalTo: view.safeAreaLayoutGuide.trailingAnchor),
            label.leadingAnchor.constraint(equalTo: view.safeAreaLayoutGuide.leadingAnchor),
            
            webView.topAnchor.constraint(equalTo: label.bottomAnchor, constant: 50),
            webView.leadingAnchor.constraint(equalTo: view.safeAreaLayoutGuide.leadingAnchor,constant: 20),
            webView.trailingAnchor.constraint(equalTo: view.safeAreaLayoutGuide.trailingAnchor,constant: -20),
            webView.bottomAnchor.constraint(equalTo: view.safeAreaLayoutGuide.bottomAnchor)
        ])
        
        webView.loadHTMLString(htmlString, baseURL: nil)
    }
}

